import React from 'react'
import './caro2.css';
import car from '../../Image/car.png'
import car2 from '../../Image/car2.png'
import car3 from '../../Image/car3.png'
import car4 from '../../Image/car4.png'
import car1 from '../../Image/car1.png'
import carb1 from '../../Image/carb1.png'
import Avatar from '@material-ui/core/Avatar';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import DialogTitle from '@material-ui/core/DialogTitle';
import Dialog from '@material-ui/core/Dialog';
import PersonIcon from '@material-ui/icons/Person';
import AddIcon from '@material-ui/icons/Add';
import Typography from '@material-ui/core/Typography';
import { blue } from '@material-ui/core/colors';
// import { NavLink } from 'react-router-dom';

const Caro2 = () => {
    return (
        <>


            <div id="carouselExampleInterval" className="carousel slide" data-bs-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active" data-bs-interval=" false">
                    <div className="row">
                    <div className="col-sm-6"><a href="#" className="thumbnail"><img src={car} alt="Image" style={{maxWidth:'100%'}}/></a>
                    </div>
                    <div className="col-sm-6"><a href="#" className="thumbnail"><img src={car2} alt="Image" style={{maxWidth:'100%'}}/></a>
                    </div>

                  </div>
    </div>
                        <div className="carousel-item" data-bs-interval="false ">
                        <div className="row">
                        <div className="col-sm-6"><a href="#" className="thumbnail"><img src={ car2} alt="Image" style={{maxWidth:'100%'}}/></a>
                        </div>
                        <div className="col-sm-6"><a href="#" className="thumbnail"><img src="http://placehold.it/250x250/0ff" alt="Image" style={{maxWidth:'100%'}}/></a>
                        </div>

                      </div>
    </div>

                            </div>
                            <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="prev">
                                <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                                <span className="visually-hidden">Previous</span>
                            </button>
                            <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleInterval" data-bs-slide="next">
                                <span className="carousel-control-next-icon" aria-hidden="true"></span>
                                <span className="visually-hidden">Next</span>
                </button>
                <Typography variant="subtitle1">Selected: {selectedValue}</Typography>
                <br />
                <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                    Open simple dialog
</Button>
                <SimpleDialog selectedValue={selectedValue} open={open} onClose={handleClose} />
            </div>



        </>
    )
}

export default Caro2;
